import React from 'react';

function Certificate() {
  return (
    <div className="certificate">
      <h2>Certificate</h2>
      <ul>
        <li><strong>AWS Solutions Architect Associate Certification (2024.08)</strong></li>
        <li><strong>GCP Associate Cloud Engineer Certification (2024.07)</strong></li>
      </ul>
    </div>
  );
}

export default Certificate;
